import Header from "./Header";
import Footer from "./Footer";
import Mid from "./Mid";
import pic from './logo.svg'
import Mid2 from "./Mid2";


export default function App(){
    return(
        <div>
        <Header/>
        <Mid img={pic}
               title='LG TV'
               desc="Rs. 40000"/>
      
        <Mid img={pic}
               title='Samsung TV'
               desc="Rs. 50000"/>
      
        <Mid img={pic}
               title='Iphone 12'
               desc="Rs. 80000"/>
      
        <Mid img={pic}
               title='OnePlus'
               desc="Rs. 60000"/>
        
      
        <Mid2/>
         <Footer/>
        </div>

    );
}
